import { useContext } from "react";
import AuthContext from "../AuthContext";
import { useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";

const Dashboard = () => {
  const { logout } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div>
      {/* E-Mart Navbar - Advanced Design */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-primary shadow-lg fixed-top">
        <div className="container">
          <a className="navbar-brand fw-bold fs-3 logo" href="#">E-Mart</a>
          <button 
            className="navbar-toggler" 
            type="button" 
            data-bs-toggle="collapse" 
            data-bs-target="#navbarNav" 
            aria-controls="navbarNav" 
            aria-expanded="false" 
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse justify-content-between" id="navbarNav">
            <ul className="navbar-nav mx-auto">
              <li className="nav-item">
                <a className="nav-link active fs-5 px-3 nav-item-hover" href="#">Home</a>
              </li>
              <li className="nav-item">
                <a className="nav-link fs-5 px-3 nav-item-hover" href="#">Products</a>
              </li>
              <li className="nav-item">
                <a className="nav-link fs-5 px-3 nav-item-hover" href="#">Categories</a>
              </li>
              <li className="nav-item">
                <a className="nav-link fs-5 px-3 nav-item-hover" href="#">Orders</a>
              </li>
              <li className="nav-item">
                <a className="nav-link fs-5 px-3 nav-item-hover" href="#">Contact</a>
              </li>
            </ul>
            <button className="btn btn-light fw-bold btn-hover" onClick={handleLogout}>Logout</button>
          </div>
        </div>
      </nav>

      {/* Page Content Below Navbar */}
      <div className="container mt-5 pt-5 text-center">
        <h1 className="fw-bold">Welcome to E-Mart Dashboard</h1>
        <p className="fs-5 text-muted">Manage your products, orders, and categories efficiently.</p>
      </div>
    </div>
  );
};

export default Dashboard;
